import React from 'react';
import { Routes, Route, Link } from "react-router-dom";
import "./styles.css";
import Privacy from '../../pages/Privacy/Privacy';
import logo from "../../assets/images/logo.png";
import yt from "../../assets/images/youtubeicon.png";
import insta from "../../assets/images/instaicon.png";
import vim from "../../assets/images/vimeo.png";
import patch from '../../assets/images/patch.png';

const policy = 'https://www.termsfeed.com/live/3ff4cb31-9902-4140-a588-0e09210e1439'
const youtube = 'https://www.youtube.com/channel/UCwESxTwtk_cQMcAeRQvsN7g';
const vimeo = 'https://vimeo.com/user160167080';

function Footer() {

    return (
        <div id="footer-div">
            <section id="container">
                <div>
                    <img id="footer-logo" src={patch}></img>
                </div>
                <div id="footer-title">
                    <h3>Sequence Department</h3>
                    <p>SQ-DPT is a production and creative company based out of Savannah, Georgia.</p>
                </div>
                <div id="footer-nav">
                        <a className='footer-text' href={"#header"}>SQ-DPT</a>
                        <a className='footer-text' href={"#about-page"}>About</a>
                        <a className='footer-text' href={"#project-page"}>Projects</a>
                        <a className='footer-text' href={"#contact-page"}>Contact</a>
                        <a className='footer-text' href={policy} target='_blank'>Privacy Policy</a>
                </div>
                <div id="footer-social">
                    <img className="icon" src={vim}></img>
                    <img className="icon" src={yt}></img>
                    <img className="icon" src={insta}></img>
                </div>
            </section>
        </div>
    );
}

    export default Footer;
